import 'bootstrap/dist/css/bootstrap.min.css';
import './components/CreatePage.css'

function App() {
  return (
    <div className="centered-wrapper">
      <div>
    <Form.Group>
      <Row>
      <Form.Label column="sm" lg={2}>
      Large Text
    </Form.Label>
    <Col>
      <Form.Control size="lg" type="text" placeholder="Large text" bsPrefix="custom-input" />
    </Col>
      </Row>
</Form.Group>
</div>
</div>
  );
}

export default App;
